#!/usr/bin/env python3
"""
Consolidate and filter Google Maps Scraper results from all zones.
Creates all_companies_raw.csv with Selangor manufacturers that have websites.
"""

import json
import csv
import os

# Target manufacturing categories
TARGET_CATEGORIES = {
    'manufacturer', 'food manufacturer', 'electronics manufacturer',
    'packaging company', 'warehouse', 'steel fabricator',
    'plastic fabrication company', 'mill', 'factory equipment supplier',
    'brewery', 'car factory', 'furniture manufacturer', 'paper mill',
    'food processing company', 'plastic injection molding service',
    'aerospace company', 'industrial gas supplier', 'clothing manufacturer',
    'iron works', 'sugar factory', 'flour mill'
}

def matches_category(categories):
    """Check if any category matches target categories."""
    if not categories:
        return False
    for cat in categories:
        cat_lower = cat.lower()
        if cat_lower in TARGET_CATEGORIES:
            return True
        if cat_lower.startswith('plastic re'):
            return True
    return False

def filter_companies(data, zone_name):
    """Filter companies for Selangor state and target categories."""
    filtered = []
    for company in data:
        state = company.get('state', '')
        if state != 'Selangor':
            continue
        categories = company.get('categories', [])
        if not matches_category(categories):
            continue
        filtered.append({
            'company_name': company.get('title', ''),
            'state': state,
            'city': company.get('city', ''),
            'address': company.get('address', ''),
            'phone': company.get('phone', ''),
            'website': company.get('website', ''),
            'categories': ', '.join(categories) if categories else '',
            'category_name': company.get('categoryName', ''),
            'zone': zone_name
        })
    return filtered

def main():
    base_dir = '/Users/firdausismail/leadgenengine'
    all_companies = []

    # Zone 1 - Already filtered (read from saved JSON)
    zone1_path = os.path.join(base_dir, 'discovery_results/zone_01_klang_raw.json')
    if os.path.exists(zone1_path):
        with open(zone1_path, 'r') as f:
            zone1_data = json.load(f)
            for company in zone1_data:
                all_companies.append({
                    'company_name': company.get('title', ''),
                    'state': company.get('state', ''),
                    'city': company.get('city', ''),
                    'address': company.get('address', ''),
                    'phone': company.get('phone', ''),
                    'website': company.get('website', ''),
                    'categories': ', '.join(company.get('categories', [])),
                    'category_name': company.get('categoryName', ''),
                    'zone': 'Klang'
                })
        print(f"Zone 1 (Klang): {len(zone1_data)} companies")

    # Zones 2-6 data embedded (from API responses)
    zones_data = {
        'Subang Jaya': ZONE2_DATA,
        'Rawang': ZONE3_DATA,
        'Semenyih': ZONE4_DATA,
        'Sepang': ZONE5_DATA,
        'Banting': ZONE6_DATA
    }

    for zone_name, zone_data in zones_data.items():
        filtered = filter_companies(zone_data, zone_name)
        all_companies.extend(filtered)
        print(f"Zone {zone_name}: {len(filtered)} companies after filtering")

    # Remove duplicates based on company_name + website
    seen = set()
    unique_companies = []
    for company in all_companies:
        key = (company['company_name'], company['website'])
        if key not in seen:
            seen.add(key)
            unique_companies.append(company)

    # Filter to only companies with websites
    companies_with_websites = [c for c in unique_companies if c['website']]

    print(f"\nTotal unique companies: {len(unique_companies)}")
    print(f"Companies with websites: {len(companies_with_websites)}")

    # Write to CSV
    output_path = os.path.join(base_dir, 'all_companies_raw.csv')
    fieldnames = ['company_name', 'website', 'phone', 'city', 'address', 'categories', 'category_name', 'zone', 'state']

    with open(output_path, 'w', newline='', encoding='utf-8') as f:
        writer = csv.DictWriter(f, fieldnames=fieldnames)
        writer.writeheader()
        writer.writerows(companies_with_websites)

    print(f"\nSaved to: {output_path}")
    return companies_with_websites

